import React, { useState } from "react";
import axios from "axios";
import { useNavigate } from "react-router-dom";

const Signup = () => {
  const navigate = useNavigate();
  const [formData, setFormData] = useState({
    username: "",
    email: "",
    password: "",
    experience: "",
    skills: "",
    interest_area: "",
  });

  const handleChange = (e) => {
    setFormData({ ...formData, [e.target.name]: e.target.value });
  };

  const handleSubmit = async (e) => {
    e.preventDefault();
    await axios.post("http://127.0.0.1:8000/signup/", formData);
    navigate("/login");
  };

  return (
    <div className="min-h-screen flex items-center justify-center bg-gray-100">
      <form className="bg-white p-6 rounded shadow-md w-96" onSubmit={handleSubmit}>
        <h2 className="text-xl font-bold mb-4">Signup</h2>
        <input name="username" type="text" placeholder="Username" onChange={handleChange} className="w-full p-2 border rounded mb-2"/>
        <input name="email" type="email" placeholder="Email" onChange={handleChange} className="w-full p-2 border rounded mb-2"/>
        <input name="password" type="password" placeholder="Password" onChange={handleChange} className="w-full p-2 border rounded mb-2"/>
        <textarea name="experience" placeholder="Experience" onChange={handleChange} className="w-full p-2 border rounded mb-2"></textarea>
        <textarea name="skills" placeholder="Skills" onChange={handleChange} className="w-full p-2 border rounded mb-2"></textarea>
        <textarea name="interest_area" placeholder="Interest Area" onChange={handleChange} className="w-full p-2 border rounded mb-2"></textarea>
        <button type="submit" className="w-full bg-blue-500 text-white py-2 rounded">Sign Up</button>
      </form>
    </div>
  );
};

export default Signup;
